import React, { Component } from "react";
import { isAuth, signout } from "../../actions/auth";
import Router from "next/router";
import { Breadcrumb, Icon, Row, Col, Layout, Card, Carousel, Button, Divider ,Drawer} from "antd";
// import { fetchProfiles } from "../../redux/actions/dashboardAction";
import RightMenu from '../Layout/RightMenu';
import LeftMenu from '../Layout/RightMenu';
import { connect } from "react-redux";
import Input from "../Common/Input";

import { Menu } from 'antd';
import { MailOutlined, AppstoreOutlined, SettingOutlined } from '@ant-design/icons';

const { SubMenu } = Menu;
class Navbar extends Component {
  state = {
    current: 'mail',
    visible: false
  }
  showDrawer = () => {
    this.setState({
      visible: true,
    });
  };
onClose = () => {
    this.setState({
      visible: false,
    });
  };
  render() {
    const { current } = this.state;
    return (
      <nav className="menuBar">
        <div className="logo">
          <a href="">logo</a>
        </div>
        <div className="menuCon">
          <div className="leftMenu">
            <LeftMenu />
          </div>
          <div className="rightMenu">
              <RightMenu />
          </div>
          <Button className="barsMenu" type="primary" onClick={this.showDrawer}>
            <span className="barsBtn"></span>
          </Button>
          <Drawer
            title="Basic Drawer"
            placement="right"
            closable={false}
            onClose={this.onClose}
            visible={this.state.visible}
          >
            <LeftMenu />
            <RightMenu />
          </Drawer>
</div>
      </nav>
    )
  }}
const mapStateToProps = (state) => {
  return {
    users: state.profiles,
  };
};
function mapDispatchToProps(dispatch) {
  //   return {
  //     fetchProfiles: data => {
  //       dispatch(fetchProfiles(data));
  //     }
  //   };
}
export default connect(mapStateToProps, mapDispatchToProps)(Navbar);
